import React from 'react';
import './DualProductivityCell.css';

const DualProductivityCell = ({ 
  selfReportedHours = 0, 
  systemTrackedHours = 0, 
  selfReportedUnits = 0, 
  systemTrackedUnits = 0 
}) => {
  const formatNumber = (num) => {
    if (num === null || num === undefined || num === 0) return '-';
    return new Intl.NumberFormat('en-US').format(num);
  };

  return (
    <div className="dual-productivity-cell">
      <table className="productivity-table">
        <thead>
          <tr>
            <th></th>
            <th>Self-Reported</th>
            <th>System Tracked</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td className="productivity-label"><em>Hours</em></td>
            <td className="productivity-value">{formatNumber(selfReportedHours)}</td>
            <td className="productivity-value">{formatNumber(systemTrackedHours)}</td>
          </tr>
          <tr>
            <td className="productivity-label"><em>Units</em></td>
            <td className="productivity-value">{formatNumber(selfReportedUnits)}</td>
            <td className="productivity-value">{formatNumber(systemTrackedUnits)}</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default DualProductivityCell;
